import React from "react";
import styled from "styled-components";
import img from "../images/disney-hotstar-dark-logo.svg";
const Header = () => {
  return (
    <>
      <MainHeader>
        <img src={img} alt="asa" />
      </MainHeader>
    </>
  );
};

export default Header;

const MainHeader = styled.div`
  position: fixed;
  margin: 0 auto;
  top: 0;
  left: 0;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  height: 72px;
  background-color: #121926;
  width: 100vw;
  font-family: "Roboto", "HelveticaNeue-Light", sans-serif;
`;
